				base, Vector = me.ns.Vector,
				origin = new Vector(w * 0.5, h * 0.5); // center
	
			me.width = w;
			me.height = h;
			me.paper = paper;
			base = Math.pow((Math.pow(rt.amount, 0.6) + Math.pow(rt.maxChildAmount, 0.6)*2) / maxRad, 1.6666666667);
			me.a2radBase = me.ns.a2radBase = base;
	
